module.exports = {

	template: require('./template.html'),

	ready: function () {

		_.defaults(this.$data, {
			groupSize: 5
		});

		// update the stats object when the rows data changes
		this.$watch('rows', this.updateStats, true, true);

	},

	methods: {

		// update table stats
		updateStats: function() {
			var self = this;

			var newCounter = function() {
				return {
					'complete': 0,
					'total': 0
				};
			};

			var stats = {
				total: newCounter(),
				byRow: [],
