				'parent_region_id' : 'parent',
				'name'             : 'title',
				'id'               : 'value'
			}
		});

		this._regions.$on('dropdown-value-changed', function (items) {
			self.regions = _.values(items);
		});

		this._indicators = new Dropdown({
