            transform={'translate(0,' + contentHeight + ')'}></g>
          <g className='data'></g>
          <g className='annotation'></g>
        </g>
      </svg>
    )
  },

  componentDidMount : function () {
    window.addEventListener('resize', this._resize);
    this._resize();
  },

  _resize : function () {
